import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";

const AppLayout = ({ children }) => {
    return (
        <div>
            <div>
                <Link href="/">
                    <a>노드버드</a>
                </Link>
            </div>
            <div>공통 메뉴</div>
            {children}
        </div>
    );
};

AppLayout.propTypes = {
    children: PropTypes.node.isRequired, //return 안에 들어갈 수 있는 모든 것들은 node 타입이다.
};

export default AppLayout;
